  ipv6: false
  # fake-ip-range: 198.18.0.1/16
  default-nameserver:
    - system
  nameserver:
    - system
proxies:
  - name: aws-sg
    type: vmess
    server: aws-sg.zsq1.xyz
    port: 16823
    uuid: 5d601f1c-7b05-46e8-9d99-389b8258b02d
    alterId: 0
    cipher: auto
    udp: true
proxy-groups:
  - name: PROXY
    type: select
    proxies:
      - DIRECT
      - REJECT
      - 🇭🇰 香港
      - 🇸🇬 新加坡
      - 🇯🇵 日本
      - 🇹🇼 台湾
      - 🇺🇸 美国
      - 其他
      - ♻️ 自动选择
  - name: PROXY-special
    type: select
    proxies:
      - 🇸🇬 新加坡
      - DIRECT
      - ♻️ 自动选择
      - 🇭🇰 香港
      - 🇯🇵 日本
      - 🇹🇼 台湾
      - 🇺🇸 美国
      - 其他
  - name: 🐟 漏网之鱼
    type: select
    proxies:
      - DIRECT
      - REJECT
      - PROXY
  - name: 🇭🇰 香港
    <<: *a2
    filter: (?i)港|hk|hongkong|hong kong
  - name: 🇸🇬 新加坡
    proxies:
      - aws-sg
    <<: *a2
    filter: (?i)^(?!.*(?:us)).*(新|sg|singapore)
  - name: 🇯🇵 日本
    <<: *a2
    filter: (?i)日|jp|japan
  - name: 🇹🇼 台湾
    <<: *a2
    filter: (?i)台|tw|taiwan
  - name: 🇺🇸 美国
    <<: *a2
    filter: (?i)美|us|unitedstates|united states
  - name: 其他
    <<: *a2
    filter: (?i)^(?!.*(?:🇭🇰|🇯🇵|🇺🇸|🇸🇬|🇨🇳|港|hk|hongkong|台|tw|taiwan|日|jp|japan|新|sg|singapore|美|us|unitedstates)).*
  - name: Ⓜ️ 微软服务
    type: select
    proxies:
      - 🇭🇰 香港
      - DIRECT
      - ♻️ 自动选择
      - 🇸🇬 新加坡
      - 🇯🇵 日本
      - 🇹🇼 台湾
      - 🇺🇸 美国
      - 其他
  - name: 🔗外网镜像源
    <<: *a3
  - name: 特殊程序
    <<: *a3
  - name: 🤖 ai网站
    type: select
    proxies:
      - 🇸🇬 新加坡
      - DIRECT
      - ♻️ 自动选择
      - 🇭🇰 香港
      - 🇯🇵 日本
      - 🇹🇼 台湾
      - 🇺🇸 美国
      - 其他
  - name: 🅱️️ 哔哩哔哩港澳台
    type: select
    proxies:
      - DIRECT
      - REJECT
      - 🇭🇰 香港
      - 🇹🇼 台湾
      - 🇸🇬 新加坡
      - 🇯🇵 日本
    filter: 香港|澳门|台湾
    exclude-filter: 仅
  - name: 📺 流媒体 - NETFLIX/Disney/
    type: select
    proxies:
      - 🇭🇰 香港
      - DIRECT
      - 🇸🇬 新加坡
      - 🇯🇵 日本
      - 🇹🇼 台湾
      - 🇺🇸 美国
      - ♻️ 自动选择
      - 其他
  - name: 🎮️ 游戏
    <<: *a3
  - name: 🍎 苹果服务
    <<: *a3
  - name: 全部
    <<: *a2
  - name: 🎯 全球直连
    type: select
    proxies:
      - DIRECT
      - REJECT
      - PROXY
  - name: ♻️ 自动选择
    <<: *a2
    tolerance: 2
    type: url-test
  - name: 🛑 全球拦截
    type: select
    proxies:
      - REJECT
      - DIRECT
      - PROXY
  - name: 订阅链接/机场官网
    type: select
    proxies:
      - DIRECT
      - PROXY
